import React from 'react';
import { createAppContainer } from 'react-navigation';
import { createStackNavigator } from 'react-navigation-stack'
import Home from './screens/Home'
import ExploreList from './screens/ExploreList';
import WebViewNews from './screens/WebViewNews';
import GameList from './screens/GameList';
import GameDetails from './screens/GameDetails';


const screens = {
    
    Home: {
        screen: Home
    },
    WebViewNews: {
        screen: WebViewNews,
    },
    ExploreList: {
        screen: ExploreList,
    },
    GameList: {
        screen: GameList,
    },
    GameDetails: {
        screen: GameDetails,
    },
}

const RouteStack = createStackNavigator({ screens } , { initialRouteName: Navigator });
export default createAppContainer(RouteStack);
